define({"topics":[{"title":"Download <span class=\"ph\">Airwall Edge Services<\/span> firmware updates","shortdesc":"<p class=\"shortdesc\">In v2.2.8 and later, the <span class=\"ph\">Conductor<\/span> Settings page         shows a list of the Firmware updates available for your <span class=\"ph\">Airwall secure network<\/span>,         and makes it easy to download and install firmware updates. <\/p>","href":"content\/topics\/hipswitch_firmware_upload.html","attributes":{"data-id":"cond_firmware_upload"},"menu":{"hasChildren":false},"tocID":"cond_firmware_upload-d8884e4303","topics":[]},{"title":"Update <span class=\"ph\">Airwall Gateway<\/span> firmware","shortdesc":"<p class=\"shortdesc\">You can update the firmware for a single <span class=\"ph\">Airwall Gateway<\/span> from the <span class=\"ph\"><span class=\"ph uicontrol\">Airwalls<\/span><\/span> page.<\/p>","href":"content\/topics\/hipswitch_firmware_targeted.html","attributes":{"data-id":"cond_firmware_targeted"},"menu":{"hasChildren":false},"tocID":"cond_firmware_targeted-d8884e4323","topics":[]},{"title":"Update firmware for a group of <span class=\"ph\">Airwall Edge Services<\/span>","shortdesc":"<p class=\"shortdesc\">There are two ways to update firmware for multiple <span class=\"ph\">Airwall Edge Services<\/span> at a         time. One is to update using <span class=\"ph\">Airwall<\/span> groups, and the         other is to update by firmware update package.<\/p>","href":"content\/topics\/hipswitch_firmware_group_upd.html","attributes":{"data-id":"cond_firmware_group_upd"},"menu":{"hasChildren":false},"tocID":"cond_firmware_group_upd-d8884e4344","topics":[]}]});